import {FORMULARIO_PROYECTO, OBTENER_PROYECTOS} from '../../types/index'

export default (state,action)=>{
    switch(action.type){
        case FORMULARIO_PROYECTO:
            return ({
                ...state,
                formulario:true
            })
        default:
                return state;
    }
}
